			var i = 0,
				len = 0;
			len = tableList.length;
			var tCode;
			var codeList;
			codeList = [];
			for (i = 0; i < len; i++) {
				tCode = CodeManager.createTableCode(tableList[i]);
				if (tCode) {
					codeList.push(tCode);
				}
			}
			if (codeList.length < 1) return "";
